if not words:
    return {}
if not words[0]:
    return {}
if len(words) == 1:
    return {words[0]: {}}
root = {}
for word in words:
    current = root
    for letter in word:
        if letter not in current:
            current[letter] = {}
        current = current[letter]
    current[""] = {}
return root

